pub fn bubble_sort<T, U>(array: &mut Vec<T>, comparator: U) where T: PartialOrd, U: Fn(&T, &T) -> bool,
{ let length = array.len(); for i in 0..(length - 1) { for j in (i + 1)..length { if comparator(&array[j], &array[i]) { array.swap(i, j); } } }
} let mut v = vec![20, 12, 45, 19, 91, 55];
#println!("before: {:?}", v);
bubble_sort(&mut v, |a, b| a < b);
#println!("sorted: {:?}", v);
#assert_eq!(vec![12, 19, 20, 45, 55, 91], v)

